var fs = require("fs");
var escodegen = require("escodegen");
var esprima = require("esprima");
var esmangle = require("esmangle");


var ast = esprima.parse(fs.readFileSync("test.js"));


result = esmangle.optimize(ast, null, {
    passes: {
        treeBasedConstantFolding: true
    }
});


console.log(escodegen.generate(result, { }));
